import React from "react";
import { Link } from "react-router-dom";

export function Model({ data, id }) {
  return (
    <div>
      {data.map((item) => {
        return (
          <Link to={`/product/${id}/${item.name}`}>
            <li key={item.index}>
              {item.name} {item.nb_place}
            </li>
          </Link>
        );
      })}
    </div>
  );
}

export function Modelprez() {
  return (
    <div className="container__prez">
      <div className="container__prez--image">image</div>
      <div className="container__prez--text">image</div>
    </div>
  );
}

export default function Features() {
  return (
    <div className="container__feat">
      <div className="container__feat--list"></div>
    </div>
  );
}
